import React from 'react';

function Products() {
  return (
    <div>
      <section>
        <img src="/product-banner.jpg" alt="Banner" style={{ width: '100%', maxHeight: 320, objectFit: 'cover', borderRadius: 8 }} onError={e => {e.target.style.display='none'}} />
        <div style={{ color: '#fff', fontWeight: 700, margin: 16, fontSize: 20 }}>Phát triển cơ bắp, Whey Protein, BCAA, Vitamin, Phụ kiện...</div>
      </section>
      <section>
        <div style={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'center', gap: 24 }}>
          {[1,2,3,4,5,6].map(i => (
            <div key={i} style={{ width: 120, textAlign: 'center' }}>
              <img src={`/whey${i}.jpg`} alt={`Whey ${i}`} style={{ width: 100, height: 120, objectFit: 'cover', borderRadius: 8 }} onError={e => {e.target.style.display='none'}} />
              <div style={{ color: '#fff', marginTop: 8 }}>WHEY</div>
            </div>
          ))}
        </div>
      </section>
      <section className="black-bg">
        <button className="btn">LIÊN HỆ CHÚNG TÔI</button>
      </section>
    </div>
  );
}

export default Products;
